import React from "react";
import { Container, Row, Col } from "react-bootstrap";
import ItemList from "../components/itemList.js";
const Shop = () => {
  return (
<Container>
<Row className="mt-2">
  <Col md={9}>
    <ItemList/>
  </Col>
</Row>
</Container>
  );
}

export default Shop;
